import Head from "next/head";
import styled from "styled-components";
const Test = styled.div`
  color: red;
`;
const Index = () => (
  <div>
    <Head>
      <title>Index 페이지</title>
    </Head>
    <button type="button" class="btn btn-primary">
      Primary
    </button>
    <Test>dfdf</Test>
  </div>
);

export default Index;
